int nprime;
int prime[18888];
int n, a, b, c, d;

void InitPrime() {
    nprime = 0;
    for (int i = 2;  i <= BOUND;  ++i) {
        bool check = true;
        for (int j = 2;  j <= sqrt(i);  ++j) {
            if (i % j == 0) {
                check = false;
                break;
            }
        }
        if (check) {
            prime[++nprime] = i;
        }
    }
}

unsigned long long sqr(unsigned long long x) {
    return (x * x) & MOD;
}

unsigned long long cube(unsigned long long x) {
    return (sqr(x) * x) & MOD;
}

unsigned long long f(unsigned long long x) {
    return (((cube(x) * a) & MOD) + ((sqr(x) * b) & MOD) + ((x * c) & MOD) + d) & MOD;
}

unsigned long long Calc(int x) {
    unsigned long long cnt = 0, p = x;
    while (p <= n) {
        cnt = (cnt + n / p) & MOD;
        p = p * x;
    }
    return (cnt * f(x)) & MOD;
}

bool isPrime(int x) {
    if (x <= 1) return false;
    for (int i = 1;  i <= nprime;  ++i) {
        if (prime[i] > x / prime[i]) return true;
        if (x % prime[i] == 0) return false;
    }
    return true;
}

void ComputeSum() {
    unsigned long long ans = 0;
    for (int i = 2;  i <= 300000000;  ++i) {
        if (isPrime(i)) {
            ans = (ans + cube(i)) & MOD;
        }
        if (i % 500000 == 0) {
            cout << ans << ",";
        }
    }
}

unsigned long long Compute(unsigned long long x) {
    unsigned long long t = x / 500000;
    unsigned long long ans = (t == 0 ? 0 
                                     : ((long long)arr1[t - 1] * c % MODULO
                                      + (long long)arr2[t - 1] * b % MODULO
                                      + (long long)arr3[t - 1] * a % MODULO
                                      + (long long)arr0[t - 1] * d % MODULO) % MODULO);
    for (unsigned long long i = t * 500000 + 1;  i <= x;  ++i) {
        if (isPrime(i)) {
            ans = (ans + ((i * c) & MOD) + (((sqr(i) * b) & MOD) + ((cube(i) * a) & MOD) + d)) & MOD;
        }
    }
    return ans;
}

unsigned long long Reverse(unsigned long long x) {
    return (MODULO - x + MODULO) % MODULO;
}

unsigned long long Brute(int x) {
    unsigned long long ans = 0;
    for (unsigned long long i = 1;  i <= x;  ++i) {
        if (isPrime(i)) {
            ans = (ans + ((i * c) & MOD) + ((((i * i) & MOD) * b) & MOD) + ((((((i * i) & MOD) * i) & MOD) * a) & MOD) + d) & MOD;
        }
    }
    return ans;
}

int main() {
    InitPrime();
    cin >> n >> a >> b >> c >> d; 

    unsigned long long ans = 0;
    for (int i = 1;  i <= nprime;  ++i) {
        if (prime[i] > n) break;
        ans = (ans + Calc(prime[i])) & MOD;
    }

    
    unsigned long long last = Compute(BOUND);
    for (int wat = 30;  wat >= 1;  --wat) {
        if (n / wat > BOUND) {
            unsigned long long now = Compute(n / wat);
            ans = (ans + now + Reverse(last)) & MOD;
        }
    }

    for (unsigned long long i = BOUND + 1;  i <= n / 31;  i++) {
        if (isPrime(i)) {
            ans = (ans + ((f(i) * ((n / i) - 30)) & MOD)) & MOD;
        }
    }
    cout << ans << endl;
    return 0;
}
